function processData() {
    var extractPartName = function(path) { 
        return path
        // return path.replace(/.*\/(.*\/.*)\.json/, "$1")
    }
    var partNames = this.logEntries.collect(function(ea) {
            return extractPartName(ea.path)
        }).uniq()
    this.partHistogram = {}
    this.lastAuthor = {}
    this.lastModified = {}
    this.authorHistogram = {}

    partNames.each(function(ea) {this.partHistogram[ea] = 0}.bind(this))
    this.logEntries.each(function(ea) {
        var key = extractPartName(ea.path)
        this.partHistogram[key]++
        this.lastAuthor[key] = ea.author
        this.lastModified[key] = ea.date
        if (!this.authorHistogram[ea.author])
            this.authorHistogram[ea.author] = 0;
        this.authorHistogram[ea.author]++
    }.bind(this))

    this.authors = Properties.own(this.authorHistogram).sortBy(function(ea) {
        return this.authorHistogram[ea]
    }.bind(this))

    this.tree = {}
    var insertInTree = function(path, obj) {
        if (path.length == 0)
            return obj
        var first = path.shift() || "/"
        if (!obj[first]) {
            obj[first] = {}
        }
        return insertInTree(path, obj[first])
    }

    Properties.own(this.partHistogram)
        .select(function(ea) { 
            return this.partHistogram[ea] > this.minChanges 
        }.bind(this))
        .forEach(function(ea) {
            var path = ea.split("/")
            var node = insertInTree(path, this.tree)
        }.bind(this))
}

