function filterData() {
    var pattern = this.filterPattern
    if (!pattern) {
        this.logEntries = this.allLogEntries;
        return
    }
    this.logEntries = this.allLogEntries.select(function(ea) {
        return ea.path.match(pattern)
    })
}

