function updateView() {
    var d3Vis = this.get('d3Wrapper')
    var self = this;
    var convertTree = function(name, obj, path) {
        var props = Properties.own(obj)
        if (props.length == 0) {
            var fullpath = (path + "/" + name).replace(/\/+/g,"/");
            return {
                name: name,
                lastModified: self.lastModified[fullpath],
                lastAuthor: self.lastAuthor[fullpath],
                value: self.partHistogram[fullpath] || 1
            }
        } else {
            return {
                name: name,
                children: props.collect(function(ea) {
                    return convertTree(ea, obj[ea], path + "/" + name)
                })
            }
        }
    }
    d3Vis.data = convertTree('', this.tree, '')
    d3Vis.data.authors = this.authors;
    d3Vis.draw();
}

